import React from 'react';
import { MdCheck } from 'react-icons/md';

import { Container, Input, ButtonIn, Register } from './styles';

export default function Login() {
  return (
    <Container>
      <Input placeholder="Email" />
      <Input placeholder="Senha" />
      <ButtonIn>Entrar</ButtonIn>
      <Register>
        Não tem uma conta? <small>Registre-se!</small>
      </Register>
    </Container>
  );
}
